/**
 * Function for copying text to the clipboard
 * @param element
 */
async function copy(element) {
    const textToCopy = $(element).text();
    try {
        if (window.location.protocol === 'https:') {
            await navigator.clipboard.writeText(textToCopy);
        } else {
            console.warn("Insecure access to the Clipboard has toggled");
            const $tmp = $("<input>").val(textToCopy).appendTo("body").select();
            document.execCommand("copy");
            $tmp.remove()
        }
    } catch (err) {
        alert("Failed to copy: " + err.message);
    }
}